// STYLES 
import './component-styles/Gallery.css'

const Gallery = ({ product }) => {
  console.log(product.gallery)
  return (
    <div className="gallery">
      <img src="" alt="" className="gallery1" />
      <img src="" alt="" className="gallery2" />
      <img src="" alt="" className="gallery3" />
    </div>
  )
};

export default Gallery;
